import React from "react";

const Popup = (props) => {
    return (
        <div className="popup">
            <div className="popup-container">
                <img className="image-github" alt="Github profile image" />
                <h1>Emanuel dos Santos Paz</h1>
                <p>devSantos16</p>
                <p>Software Developer</p>
            </div>

        </div>
    );
}
export default Popup;
